import { Box, Paper, Typography } from '@mui/material'
import React from 'react'

export const About = () => {
    return (
        <Box
            display={'flex'}
            flexDirection={'column'}
        >
            <Typography variant={'h2'}>Hi, my name is</Typography>
            <Typography variant={'h1'}>William Ho</Typography>
        </Box>
    )

}
